import React from "react";
import { Input, Button } from 'antd';
import './style.scss';

const Filters = () => {
    return(
        <div className="filters-container">
            <Input placeholder="Nombre" />
            <Button type="primary" icon={<SearchOutlined />}>
                Buscar
            </Button>
        </div>
    )
}
export default Filters;
